import React, { Component } from 'react'
//import Banner from 'react-banner'
import './banner.css'
import "./markets.js";

class Banner extends Component {
  render(){
    return(
      <div className="banner">
        <div className="banner-bottom" onClick>
          <p>Markets</p>
        </div>
        <div className="banner-bottom">
          <p>Grafits</p>
        </div>
        <div className="banner-bottom">
          <p>Suport</p>
        </div>
      </div>
    )
  }
}
export default Banner;
